goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.constants");goog.require("axs.utils");axs.AuditRules.addRule({name:"badAriaAttributeValue",heading:"ARIA state and property values must be valid",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_aria_04",severity:axs.constants.Severity.SEVERE,relevantElementMatcher:function(element){var selector=axs.utils.getSelectorForAriaProperties(axs.constants.ARIA_PROPERTIES);return axs.browserUtils.matchSelector(element,selector)},test:function(element){for(var property in axs.constants.ARIA_PROPERTIES){var ariaProperty="aria-"+property;if(!element.hasAttribute(ariaProperty))continue;var propertyValueText=element.getAttribute(ariaProperty),propertyValue=axs.utils.getAriaPropertyValue(ariaProperty,propertyValueText,element);if(!propertyValue.valid)return!0}return!1},code:"AX_ARIA_04"});